スキッとドライ！毎日使う方にお得なビッグサイズ！<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />●内容量：１０８０ｍｌ●キシリトール（矯味剤）配合●アルコール含有※メーカーの都合により、パッケージ・仕様等は予告なく変更になる場合がございます。<BR>●特に油っぽい食事の後に、おすすめのストロングミントタイプ。●スキッとドライなストロングミントの味と香りでお口の中をすっきり清潔に保ちます。<BR><BR><BR><BR><BR>むし歯　ムシ歯　プラーク　デンタルリンス　はみがき（液体）　ミント味　お徳用サイズ　１本　１０８０ｍｌ　デンタルケア　口臭予防　口臭ケア　家庭用品＆日用雑貨　オーラルケア　口臭対策　マウスウォッシュ　家庭用品＆日用雑貨　オーラルケア　口臭対策　マウスウォッシュ<style type="text/css">
