<img src="https://image.rakuten.co.jp/jetprice/cabinet/guidepage/0520deliverydelay.jpg" >-->

■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>「プロポリンス」と「デンタルホワイトニング」のセット!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5424/1013358-01.jpg" width="600" height="525"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【使用方法】<br>「プロポリンス」<br>適量10～15ml(キャップ半分位)を口に含み、20～30秒程すすいではき出してください。<br>使用後はキャップをしっかり閉めて保管してください。<br><br>「プロポリンス　デンタルホワイトニング」<br>適量10～15ml(キャップ半分位)を口に含み、20～30秒程すすいだ後、ブラッシングしてください。<br>使用後はキャップをしっかり閉めて保管してください。<br><br>【使用上の注意】<br>内服液ではありませんので、飲まないでください。<br>用法・容量に従いご使用ください。<br>口中の異常、発疹等のアレルギー、ぜんそく等の症状があらわれたり、異常を感じた場合はご使用を中止し医師にご相談ください。<br>乳幼児の手の届かない所に保管してください。<br><br>※氷点下保存の場合、白濁する事がありますが、品質には問題ございません。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="437" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5424/1013358-02.jpg"><br><font size="3">輝く白い歯※ブラッシングによる効果</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">お口の汚れを目で見て実感できる新感覚マウスウォッシュの「プロポリンス」と、新たに誕生した「デンタルホワイトニング」のセットです。</font></td></tr></table><br><!--その他アレルギーここから--><!--保存方法と製造（販売）者情報ここから--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">お口の汚れを目で見て実感できる新感覚マウスウォッシュの「プロポリンス」と、新たに誕生した「デンタルホワイトニング」のセットです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">商品区分</font></td><td width="75%" align="left"><font color="#333333" size="-1">化粧品</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：7×14×24cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：1300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">「プロポリンス」<br>水、エタノール(溶剤)、グリセリン(湿潤剤)、クエン酸・クエン酸Na・リンゴ酸(ph調整剤)、PEG-60水添ヒマシ油(可溶化剤)、チャ葉エキス・プロポリスエキス・キシリトール・サッカリンNa(香味剤)、カラメル(着色剤)、メチルパラベン(保存剤)、香料、メントール<br><br>「プロポリンス　デンタルホワイトニング」<br>水、グリセリン(湿潤剤)、エタノール(溶剤)、PEG-60水添ヒマシ油(可溶化剤)、炭酸水素Na(洗浄剤)、フィチン酸(清掃助剤)、プロポリスエキス・キシリトール・メントール・サッカリンNa(香味剤)、メチルパラベン・セチルピリジニウムクロリド(保存剤)、香料</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">プロポリンス:洗口液<br>プロポリンス デンタルホワイトニング:液体歯みがき<br>品質保持期限:未開封3年<br>輸入製造販売元：株式会社ピエラス</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">韓国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
