■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><img src="http://image.rakuten.co.jp/manpura/cabinet/choutoku/3636bn-01.jpg" width="600" height="917"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/choutoku/3636bn-02.jpg" width="600" height="866"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/choutoku/3636bn-03.jpg" width="600" height="952"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/choutoku/3636bn-04.jpg" width="600" height="708"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/choutoku/3636bn-05.jpg" width="600" height="811"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/choutoku/3636bn-06.jpg" width="600" height="880"></td></tr></table><br><table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><h1><font color="#333333" size="3">歯をみがく時間がない時、口臭が気になる方、入れ歯・差し歯・歯列矯正中の方にも。マウスウォッシュでデンタル（オーラル）ケア！</font></h1></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">きちんと歯をみがいたつもりでも、実は取れていない汚れが！？それが口臭のモトなんです！プロポリンスならたったの20秒うがいをするだけでニオイの元となるタンパク質汚れを吸着して排出します。汚れが目で見えるから爽快感も格別！！携帯に便利な1回分パウチ★</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">個装サイズ：13×22×10cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：1400g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">使用期限：製造日より3年